  styleUrls: ['./desarrollo.component.scss']
})
export class DesarrolloComponent {

}
<div class="present">

    <div class="text">
        <h3>PÁGINA EN DESARROLLO</h3>
        <p>

        Estimados visitantes: 
        En la JOsM seguimos creciendo y mejorando nuestras instalaciones virtuales para darte los mejores contenidos. 
        Tennos un poco de paciencia, ¡esta parte de nuestra web está a punto de ver la luz! </p> 
        
        <p>   Te invitamos a seguir navegando por las<a routerLink="/inicio"> otras pestañas</a> disponibles de nuestra página web.</p> </div> 

  </div>


